import React from 'react';

import '../menu-items/menu-items.scss';


function MenuItem(props){
    return (
    <div className="menu-item" key = {props.keys}>
            <div className="content" key = {props.keys}>
                <h1 className="tittle" key = {props.keys}>{props.title}</h1>
                <span className="subtittle" key = {props.keys}>'SHOP NOW'</span>
            </div>
    </div>
    )
}

export default MenuItem;
